•• Ice Holiday punch ••

It's our favorite drink this time of the year and I try to double/triple the recipe to always have a few ready in the freezer 👏

🌿Pineapple juice
🌿Cherry jello
🌿Sugar
🌿 Water
🌿Ginger ale

Boil 2 cups water and disolve jello. Add 1 large cam pineapple juice and 4 cups cold water. Pour into freezer safe containers. Once frozen and ready to serve, remove into punch bowl, beat it up with a fork, and add ginger ale. Nom nom nom!

